import React, {Component,useState} from 'react';
import '../scss/binario.scss'

class Binario extends Component {

  state={'NumberBinaire':0}

    Vedi=(e)=>{
        e.preventDefault();
        console.log(this.state.NumberBinaire+'allo');
    }

    render() {
        return (
            <div className='binario'>
               <h3> conversione <br />base [ 10 --> 2  &&  [ 2 --> 10 ]</h3>
               <div className='forms'>
                  <div className='form'>
                      <div className='space'>
                          <h5>convert To binario</h5>
                          <form className='form_10_2 '>
                              <input type="text" placeholder="Your Number" className="txtb" name='base10' />
                              <button className='convert' onClick={this.Vedi}> ->  </button>
                          </form>
                      </div>
                      <div className='space'>
                          <h5>convert To decimal</h5>
                          <form className='form_2_10 '>
                              <input type="text" placeholder="Your Number" className="txtb" name='base10'/>
                              <button className='convert'> -> </button>
                          </form>
                      </div>
                  </div>
               </div>
            </div>
        );
    }
}

export default Binario;
